constituency-description:
The primary constituency is composed of all French territories (DROM-COM included) and cover:
- All ministries, administrations and state services;
- Critical national infrastructure operators and operators of essential services as defined by 
the French law;
- Other key players in sensitive sectors.
More information can be found on the Agence nationale de la sécurité des systèmes d'information (ANSSI) website: https://www.ssi.gouv.fr/.

	Governmental constituency – central and regional state governance authorities as well as specialized organs of state security and telecommunications of the Republic of Moldova as defined in the Government Decision № 840 of 26.07.2004 and its Annex №1; 
	Military constituency – “Military Commissariat of Chisinau Municipality”;
	Educational constituency -  academies and universities of the Republic of Moldova as defined in the Annex №1 to the Government Decision № 840 of 26.07.2004;
	Other constituency – national or international organizations and companies with which S.E. CTS established cooperation or partnership relationships.
